package com.nott.baiduAI.test;

import com.alibaba.fastjson.JSONArray;
import com.alibaba.fastjson.JSONObject;
import com.nott.baiduAI.face.FaceMatch;
import com.nott.baiduAI.face.vo.FaceVo;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.PostMapping;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController;


/**
 * @Author: wangjun
 * @Description:
 * @Date: created in 2020/3/17 10:38
 * @Modified By:
 **/
@RestController
@RequestMapping("/face")
public class FaceTestController {

    @Autowired
    private FaceMatch faceMatch;

    @PostMapping("/match")
    public String match() {
//        data:image/jpg;base64,
        FaceVo vo1 = new FaceVo("");
        FaceVo vo2 = new FaceVo("");
        JSONArray array = new JSONArray();
        JSONObject object1 = (JSONObject) JSONObject.toJSON(vo1);
        JSONObject object2 = (JSONObject) JSONObject.toJSON(vo2);
        array.add(object1);
        array.add(object2);
        String score = faceMatch.faceMatch(array);
        return score;
    }

}
